import React from 'react';
import { Box, Flex, Text, IconButton, Stack, Collapse, useDisclosure } from '@chakra-ui/react';
import { HamburgerIcon, CloseIcon } from '@chakra-ui/icons';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const { isOpen, onToggle } = useDisclosure();

  return (
    <Box>
      <Flex align="center" justify="space-between" wrap="wrap" padding={6}>
        <Flex align="center" mr={5}>
          <Text fontSize="lg" fontWeight="bold">
            Brand Name
          </Text>
        </Flex>

        <IconButton
          size="md"
          icon={isOpen ? <CloseIcon /> : <HamburgerIcon />}
          aria-label="Open Menu"
          display={{ md: 'none' }}
          onClick={onToggle}
        />

        <Stack
          direction={{ base: 'column', md: 'row' }}
          display={{ base: isOpen ? 'block' : 'none', md: 'flex' }}
          width={{ base: 'full', md: 'auto' }}
          alignItems="center"
          flexGrow={1}
          mt={{ base: 4, md: 0 }}
        >
          <Text as={Link} to="/about-us">About Us</Text>
          <Text as={Link} to="/contact">Contact Us</Text>
          {/* More links */}
        </Stack>

        <Box display={{ base: isOpen ? 'block' : 'none', md: 'block' }} mt={{ base: 4, md: 0 }}>
          <Text as={Link} to="/login">Login</Text>
        </Box>
      </Flex>

      <Collapse in={isOpen} animateOpacity>
        <MobileNav />
      </Collapse>
    </Box>
  );
};

// Mobile navigation can be a separate component if needed
const MobileNav = () => {
  // Implement mobile menu here
};

export default Navbar;
